### 前置知识：
[P3370 【模板】字符串哈希](https://www.luogu.com.cn/problem/P3370) 或者 [P3375 【模板】KMP字符串匹配](https://www.luogu.com.cn/problem/P3375)

### 简明题意:
给定串 $A,B$ ，求在串 $AAAAA\cdots$ 中 $B$ 最多可以连续匹配几次，若可以无限次连续匹配输出 `-1`

### 简明分析：
我们暴力延长 $A$ ，然后暴力匹配 $B$ ，计算最多连续匹配次数即可，匹配时用字符串哈希或 KMP 均可（给出代码中使用滚动字符串哈希）

### 如果你还不会滚动字符串哈希：
滚动字符串哈希的思想很简单，就是每次计算哈希值时在上一次哈希值的基础上**去头接尾**

注意去头的时候处理一下负数的情况，具体实现可以看下面的代码

### 需要注意的细节：
1. 延长串 $A$ 时，倍增串 $A$ 长度（理论上两倍 $B$ 长度即可，但为了保险可以多倍增几次qwq）
2. 数据卡自然溢出法（官方题解说的），所以加个模数
3. 如果最大连续匹配次数 $≥\frac{len_a}{len_b}$ ,说明是无限次连续匹配，输出 `-1`

### 代码：
```cpp
//这道题 这道题暴力怎么做？
//暴力是不是？
//加串！加串！！加串！！！
//字符串哈希查询！
#include<string>
#include<vector>
#include<iostream>
#define int long long
using namespace std;
string a,b;
vector <int> mark;
const int base=26,mod=19260817;
int hasha,hashb,ans,tot;
int fastpow(int a,int b)
{
	if(b==0)
		return 1;
	if(b==1)
		return a;
	int ans=fastpow(a,b/2);
	ans=ans*ans%mod;
	if(b&1)
		ans=ans*a%mod;
	return ans;
}
signed main()
{
	cin>>a>>b;
	//暴力加串
	while(a.size()<b.size()*2)
		a+=a;
	a+=a;a+=a;a+=a;
	//预处理哈希值
	for(int i=0;i<b.size();i++)
		hashb=(hashb*base+b[i]-'a')%mod;
	for(int i=0;i<b.size();i++)
		hasha=(hasha*base+a[i]-'a')%mod;
	int k=fastpow(base,b.size()-1);
	mark.resize(a.size());
	//特判
	if(hasha==hashb)
		mark[0]=1,tot=1;
	for(int i=b.size();i<a.size();i++)
	{
		//匹配时的处理，打上标记，更新答案
		if(hasha==hashb)
		{
			mark[i]=1;
			if(mark[i-b.size()])
				tot++;
			else
				tot=1;
			ans=max(ans,tot);
		}
		//正常的滚动哈希
		hasha=((hasha-k*(a[i-b.size()]-'a'))%mod+mod)%mod;
		hasha=(hasha*base+a[i]-'a')%mod;
	}
	//若最多连续匹配次数过大则输出-1
	if(ans>=a.size()/b.size())
		ans=-1;
	cout<<ans;
}
```

如果$|S|>|T|$，不难发现只要将$S$倍长，那么最长重复子串就一定在$SS$中，否则就一定是无穷，找这个可以通过$hash$来实现，否则我们将$S$倍长到$T$的两倍即可，实现时为了方便判断无穷需要多倍长几遍。

```cpp
const int N=2e7+5;
const int base=131;
const ll mod=192608179;

string a,b;
int tag[N];
ll ha[N],hb[N],fac[N];

ll gethash(int x)
{
    if(x+b.size()>a.size()) return -1;
    return (ha[x+b.size()-1]-ha[x-1]*fac[b.size()]%mod+mod)%mod;
}
int main()
{
    fio();
    cin>>a>>b;
    while(a.size()<b.size()*2) a=a+a;
    a=a+a,a=a+a,a=a+a;
    fac[0]=1,ha[0]=a[0]-'a',hb[0]=b[0]-'a';
    for(int i=1;i<a.size();++i) fac[i]=fac[i-1]*base%mod;
    for(int i=1;i<a.size();++i) ha[i]=(ha[i-1]*base%mod+a[i]-'a')%mod;
    for(int i=1;i<b.size();++i) hb[i]=(hb[i-1]*base%mod+b[i]-'a')%mod;
    for(int i=0;i<a.size();++i) tag[i]=hb[b.size()-1]==gethash(i);
    int ans=0;
    for(int i=a.size()-b.size();i>=0;--i) if(tag[i]) tag[i]+=tag[i+b.size()],ans=max(ans,tag[i]);
    if(ans+1>=a.size()/b.size()) print(-1);
    else print(ans);
    end();
}
```

### Part1 前言
